import React, { useState } from 'react';

const App = () => {
  const [one, two] = useState();

  const inputEvent = (e) => {
    console.log(e.target.value);
    two(e.target.value);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    four(one);
    four1(one1);
  };
  return (
    <>
      <div className="div">
        <h1>
          Hello, {three} {three1}
        </h1>
      </div>
      <form onSubmit={onSubmit}>
        <input
          type="text"
          placeholder="Enter your Name"
          onChange={inputEvent}
          name="fName"
          value={three}
        ></input>
        <br></br>
        <br></br>
        <input
          type="text"
          placeholder="Enter your Name"
          onChange={inputEvent}
          name="lName"
          value={three1}
        ></input>
        <br></br>
        <br></br>
        <button type="submit">Click Me</button>
      </form>
    </>
  );
};

export default App;
